import { useForm } from "react-hook-form";
import { useState } from "react";
import axios from "axios";

const Form = () => {
  const {
    register,
    formState: { errors, isValid },
    handleSubmit,
    reset,
  } = useForm({
    mode: "onChange",
  });


  // async function sendMail() {
  //   try {
  //     await axios
  //       .post("http://localhost:5000/send_email", {
  //         fullName,
  //         email,
  //         phone,
  //         message,
  //       });
  //     return console.log("Send succesfully");
  //   } catch (error) {
  //     return console.log("error", error);
  //   }
  // }

  const onSubmit = async (data) => {

    try {
      const response = await axios.post(
        "http://localhost:5000/send_email",
        data
      );

      console.log(response);
      reset();
    } catch (error) {
      console.log(error);
    }
    console.log(data);
  };

  return (
    <section className="form" id="cooperate">
      <div className="container">
        <div className="form__background">
          <h3 className="heading heading--white">Let's cooperate!</h3>
          <form
            name="form"
            id="form"
            className="form__body"
            action="#"
            onSubmit={handleSubmit(onSubmit)}
          >
            <div className="input__wrapper">
              <input
                type="text"
                className="form__item"
                placeholder="Company Name*"
                {...register("fullName", {
                  required: "Please enter your name",
                  minLength: {
                    value: 3,
                    message: "Minimum 3 characters",
                  },
                  pattern: {
                    value: /^[a-zA-Z0-9s]+$/,
                  },
                })}
              />
              <div className="form__error">
                {errors?.fullName && (
                  <p className="form__error-text">
                    {errors?.fullName?.message || "Error"}
                  </p>
                )}
              </div>
            </div>
            <div className="input__wrapper">
              <input
                type="email"
                className="form__item"
                placeholder="E-mail*"
                {...register("email", {
                  required: "Please enter your e-mail",
                  minLength: {
                    value: 5,
                    message: "Minimum 5 characters",
                  },
                  pattern: {
                    value:
                      /^[a-zA-Z0-9.!#$%&'*+/=?^_`{|}~-]+@[a-zA-Z0-9](?:[a-zA-Z0-9-]{0,61}[a-zA-Z0-9])?(?:\.[a-zA-Z0-9](?:[a-zA-Z0-9-]{0,61}[a-zA-Z0-9])?)*$/,
                  },
                })}
              />
              <div className="form__error">
                {errors?.email && (
                  <p className="form__error-text">
                    {errors?.email?.message || "Error"}
                  </p>
                )}
              </div>
            </div>
            <div className="input__wrapper">
              <input
                type="text"
                className="form__item"
                placeholder="Phone*"
                {...register("phone", {
                  required: "Please enter your phone",
                  minLength: {
                    value: 7,
                    message: "Minimum 7 characters",
                  },
                  pattern: {
                    value: /^(?:\+\d{1,3})?\d{10,12}$/,
                  },
                })}
              />
              <div className="form__error">
                {errors?.phone && (
                  <p className="form__error-text">
                    {errors?.phone?.message || "Error"}
                  </p>
                )}
              </div>
            </div>
            <div className="input__wrapper">
              <input
                type="text"
                name="message"
                className="form__item"
                placeholder="Comments"
                {...register("message", {

                  minLength: {
                    value: 3,
                    message: "Minimum 3 characters",
                  },
                })}
              />
            </div>
            <input
              type="submit"
              value="Contact Us"
              className="hvr-push button--submit"
              id="button"
              name="button"
              disabled={!isValid}
            />
          </form>
          <div className="form__popup">
            <div className="form__popup-wrapper">
              <img src="img/done.svg" alt="" className="form__popup-image" />
              <div className="form__popup-message">
                <h3 className="form__popup-heading">
                  Thanks for your submission!
                </h3>
                <p className="form__popup-text">
                  We'll get back to you as soon as possible
                </p>
              </div>
              <button className="ok" id="close">
                OK
              </button>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Form;
